  render() {
    return (
      <WidgetContainer>
        <h2>References</h2>
        <ul>
          <li>Lorem Ipsum</li>
          <li>Lorem Ipsum</li>
          <li>Lorem Ipsum</li>
        </ul>
      </WidgetContainer>
    )
  }
}

export default ReferenceItem
